import React from 'react'

export const Navbar = () => {
    return (
        <nav className="navbar bg-dark">

            <ul>
                <li><a href="profiles.html">Developers</a></li>
                <li><a href="register.html">Register</a></li>
                <li><a href="login.html">Login</a></li>
            </ul>
        </nav>
    )
}

export default Navbar;
